import { Navigate } from 'react-router-dom'
import styles from './gnb.module.scss'

const GNB = () => {
  const onLogoClick = () => {
    Navigate('/')
  }
  return (
    <nav className={styles.gnb}>
      <div onClick={onLogoClick}>RADI BOOKS</div>
      <button type='button'>개인정보</button>
    </nav>
  )
}

export default GNB
